import axios from "axios";

export const meraFx = (jj) => {
    // console.log("hhhhhhh ", jj)

    axios({
        method: 'post',
        url: 'https://craggycosmetic.com/api/user/mail/',
        data: {
            to: jj.to,
            from: jj.from,
            sub: jj.sub,
            body: jj.body
        },
        headers: {
            'Content-Type': 'application/json',
            'consumer_key': '3b137de2b677819b965ddb7288bd73f62fc6c1f04a190678ca6e72fca3986629'
        }
    }).then((res) => {
        console.log('res.dataddd', res.data)

        // setMailTemp(res.dataddd);
    }).then

}
